import React, { useState } from 'react';
import './Header.scss';
import '@fortawesome/fontawesome-free/css/all.min.css';
import { Link } from 'react-router-dom';
import { useTranslation } from 'react-i18next';
import { useAuth } from '../../context/AuthContext';

const Header: React.FC = () => {
    const { t, i18n } = useTranslation();
    const [isMobileNavOpen, setIsMobileNavOpen] = useState(false);
    const { isLoggedIn } = useAuth(); // Pobieramy stan logowania z kontekstu

    const changeLanguage = (lng: string) => {
        i18n.changeLanguage(lng);
    };

    return (
        <header className="header">
            <div className="header-top">
                <div className="contact-info">
                    <span className="phone"><i className="fas fa-phone"></i> +(48) 123-456-789</span>
                    <span className="email"><i className="fas fa-envelope"></i> mint@contact.com</span>
                </div>

                <div className="right-actions">
                    <div className="language-select">
                        <select onChange={(e) => changeLanguage(e.target.value)} value={i18n.language}>
                            <option value="en">ðŸ‡¬ðŸ‡§ English</option>
                            <option value="pl">ðŸ‡µðŸ‡± Polski</option>
                            <option value="de">ðŸ‡©ðŸ‡ª Deutsch</option>
                            <option value="fr">ðŸ‡«ðŸ‡· FranÃ§ais</option>
                        </select>
                    </div>
                    <div className="user-actions">
                        {!isLoggedIn && (
                            <Link to="/signup">
                                <button className="signup-button">{t('header.signup')}</button>
                            </Link>
                        )}
                        <Link to="/login"><i className="fas fa-user icon-gold"></i></Link>
                        <Link to="/cart"><i className="fas fa-shopping-cart icon-gold"></i></Link>
                    </div>
                </div>
            </div>

            <div className="header-bottom">
                <Link to="/">
                    <div className="logo">
                        <img src="/assets/images/logo.png" alt="Logo" />
                    </div>
                </Link>

                <button
                    className="menu-toggle"
                    onClick={() => setIsMobileNavOpen(!isMobileNavOpen)}
                    aria-label="Toggle navigation menu"
                >
                    <i className="fas fa-bars"></i>
                </button>

                <nav className={`navigation ${isMobileNavOpen ? 'active' : ''}`}>
                    <ul>
                        <li><Link to="/">{t('header.home')}</Link></li>
                        <li><Link to="/gold">{t('header.gold')}</Link></li>
                        <li><Link to="/silver">{t('header.silver')}</Link></li>
                        <li><Link to="/contact">{t('header.contact')}</Link></li>
                    </ul>
                </nav>

                <div className="search">
                    <input type="text" placeholder={t('header.searchPlaceholder')} />
                    <button type="submit"><i className="fas fa-search"></i></button>
                </div>
            </div>
        </header>
    );
};

export default Header;
